import React, { useState, useEffect } from "react";
import axios from "axios";
// import Comment from './Button_like_comment/Comment'
// import Share from './Button_like_comment/Share'
// import Flag from './Button_like_comment/Flag'
// import Like from './Button_like_comment/Like'

// const LeftPhoto=(props)=>{
const LeftPhoto = () => {
	const [post, setPost] = useState([]);
	// const [istrue,setistrue]=useState(false)
	// const set = props.set;
	// if(props.check)
	// {

	//   set(false)
	//   setistrue(props.check)
	//   console.log("Helllllo Vipin ")

	// }
	// else
	// {
	//   set(false)
	// }

	const [True, setTrue] = useState("False");
	useEffect(() => {
		axios.get("http://localhost:4444/Timeline").then(response => {
			console.log(response.data);
			setPost(response.data);
		});
		// },[1,istrue])
	}, []);

	return (
		<div>
			{post.map(item => {
				return (
					<div>
						<div className='contnt_2'>
							<div className='div_a'>
								<div className='div_title'>{item.Description}</div>
								<div className='btm_rgt'>
									<div className='btm_arc'>{item.name}</div>
								</div>
								<div className='div_top'>
									<div className='div_top_lft'>
										<img src='images/img_6.png' />
										Steave Waugh
									</div>
									<div className='div_top_rgt'>
										<span className='span_date'>{item.Daate}</span>
									</div>
								</div>
								<div className='div_image'>
									<img src={`http://localhost:4444/${item.image}`} alt='pet' />

									<div className='div_btm'>
										<div className='btm_list'>
											<ul>
												<li>
													<a href='#'>
														<span className='btn_icon'>
															<img src='images/icon_001.png' alt='share' />
														</span>
														Share
													</a>
												</li>
												<li>
													<a href='#'>
														<span className='btn_icon'>
															<img src='images/icon_002.png' alt='share' />
														</span>
														Flag
													</a>
												</li>
												<li>
													<a href='#'>
														<span className='btn_icon'>
															<img src='images/icon_003.png' alt='share' />
														</span>
														0 Likes
													</a>
												</li>
												<li>
													<a href='#'>
														<span className='btn_icon'>
															<img src='images/icon_004.png' alt='share' />
														</span>
														4 Comments
													</a>
												</li>
											</ul>
										</div>
									</div>
								</div>
							</div>
						</div>
					</div>
				);
			})}
		</div>
	);
};

export default LeftPhoto;
